contract ASK {

  /* a question on the exchange */
  struct Question {
    // questioner address
    address questioner;
    // incentive price
    uint256 incentive;
    // contents
    bytes contents;
  }

  Question[] public questions;

  /**
   * @dev Emitted when question is created
   */
  event QuestionCreated(address indexed questioner, uint256 indexed questionID);

  /**
   * @dev create question from questioner with incentive and contents metadata
   * @param _incentive  incentive for best answer
   * @param _meta contents metadata
   */

  function createQuestion(uint256 _incentive, bytes memory _meta)
    public
    returns (uint256)
  {
      questions.push(
            Question({
                questioner: msg.sender,
                incentive: _incentive,
                contents: _meta
            })
        );
    uint256 questionID = questions.length - 1;

    emit QuestionCreated(msg.sender, questionID);

    return questionID;
  }

  function getQuestionCount() public view returns(uint256) {
    return questions.length;
  }
}

